Product Description:
html {
        font-size: 100%;
    }
    a:focus {
        outline: thin dotted #333333;
        outline-offset: -2px;
    }
    a:hover, a:active {
        outline: 0 none;
    }
    body {
        background-color: #FFFFFF;
        margin:0;

        /* from AUI */
        color: #333333;
        font-family: Arial,sans-serif;
        font-size: 13px;
        line-height: 19px;
    }
    h1, h2, h3, h4, h5, h6 {
        margin: 0;
        padding: 0;
    }
    h1, h2, h3, h4 {
        font-family: Arial,sans-serif;
        text-rendering: optimizelegibility;
        padding-bottom: 4px;
    }
    h1:last-child, h2:last-child, h3:last-child, h4:last-child {
        padding-bottom: 0;
    }
    h1 {
        font-size: 28px;
        font-weight: normal;
        line-height: 1.2;
    }
    h2 {
        font-size: 21px;
        font-weight: normal;
        line-height: 1.3;
    }
    h3 {
        font-size: 17px;
        font-weight: normal;
        line-height: 1.24;
    }
    p {
      margin: 0 0 14px;
      padding: 0;
    }
    p:last-child {
        margin-bottom: 0;
    }
    p + p {
        margin-top: -4px;
    }
    b, strong {
        font-weight: bold;
    }
    i, em {
        font-style: italic;
    }
    blockquote {
        margin: 13px;
    }
    small {
        font-size: 12px;
    }
    img {
        border: 0 none;
        max-width: 100%;
        vertical-align: top;
    }
    td {
        float: none;
        margin-right: 0;
    }
    td, th {
        padding: 3px;
        vertical-align: top;
    }
    td:first-child, th:first-child {
        padding-left: 0;
    }
    td:last-child, th:last-child {
        padding-right: 0;
    }
    th {
        text-align: left;
    }
    tr:last-child td, tr:last-child th {
        padding-bottom: 0;
    }
    tr:first-child td, tr:first-child th {
        padding-top: 0;
    }
    a, a:visited, a:active, a:link {
        color: #007EB9;
        text-decoration: none;
    }
    a:hover {
        color: #E47911;
        cursor: pointer;
        text-decoration: underline;
    }
    p a {
        text-decoration: underline;
    }
    ul {
        /*color: #AAAAAA; Overriding this style as the color is out of sync with the rest of book description*/
        list-style-type: disc;
    }
    ol {
        color: #888888;
    }
    ul, ol {
        margin: 0 0 18px 22px;
        padding: 0;
    }
    ul li, ol li {
        margin: 0;
        word-wrap: break-word;
    }
    ul:last-child, ol:last-child {
        margin-bottom: 0 !important;
    }

    #iframeContent {
    overflow: hidden;
    }

    h2.productDescriptionHeader {
        margin-bottom: 0em;
    }

    .emptyClear {
        clear:left;
        height:0px;
        font-size:0px;
    }

    div.productDescriptionWrapper {
        margin: 0 0 1em 0;
    }

    h3.productDescriptionSource {
        font-weight:normal;
        color:#333333;
        font-size:1.23em;
        margin: .75em 0 .375em 0;
        clear:left;
    }

    .seeAll {
          margin-top: 1.25em;
          margin-left: -15px;
    }

    #technicalProductFeatures ul {
      list-style-type: disc;
      margin: 1.12em 0;
      margin-left: 20px;
    }

    #iframeContent ul {
      list-style-type: disc;
      margin-left: 20px;
    }

    ul li {
      margin: 0 0 0 20px;
    }

    ul li ul {
      list-style-type: disc;
      margin-left: 20px;
    }

    ul li ul li {
      margin: 0 0 0 20px;
    }

    .aplus h4, .aplus h5 {
        margin: 0 0 .75em 0;
        font-size: 1em;
    }

    .aplus h4 {
        color: #CC6600;
    }

    .aplus p {
        margin: 0 0 1em 0;
    }

    .aplus .break {
        clear:both;
        height:0px;
        font-size:0px;
    }

    .aplus .spacer {
        margin-bottom: 13px;
    }

    .aplus img {
        border:none;
    }

    .aplus .leftImage, .aplus .rightImage, .aplus .centerImage {
        margin-bottom: 1em;
        margin-top: 0;
        text-align:center;
        vertical-align:top;
    }

    .aplus .leftImage {
        margin-right: 15px;
        float:left;
        clear:left;
    }

    .aplus .rightImage {
        margin-left: 15px;
        float:right;
        clear:right;
    }

    .aplus .imageCaption {
        clear:both;
        padding: .5em .5em 0 .5em;
        font-size: .846em;
        display: block;
    }

    .aplus table.data {
          border-collapse: collapse;
          margin-bottom: 1.25em;
    }

    .aplus table.data th {
          font-weight: bold;
          background: #F7F7F7;
          border-style:solid;
          border-color: #CCCCCC;
          border-width:0 0 1px 1px;
    }

    .aplus table.data td {
          border-left: 1px solid #CCC;
          border-bottom: 1px dotted #CCC
    }

    .aplus table.data th, .aplus table.data td
    {
          padding:3px 10px;
          text-align:left
    }

    .aplus table.data tfoot {
          font-style: italic;
    }

    .aplus table.data caption {
          background: #eee;
          font-size: .8125em;
    }

    .aplus table.data tr td:first-child, .aplus table.data tr th:first-child {
          border-left-width:0px;
    }

    .aplus ul {
          margin:0 0 1em 0;
    }

    .aplus .center {
          text-align: center;
    }

    .aplus .right {
          text-align: right;
    }

    .aplus  .sixth-col,
    .aplus .fourth-col,
    .aplus .third-col,
    .aplus .half-col,
    .aplus .two-third-col,
    .aplus .three-fourth-col,
    .aplus .one-col {
        float:left;
        margin-right: 1.6760%;
        overflow: hidden;
    }

    .aplus .last {
        margin-right:0px;
    }

    .aplus .sixth-col {
        width: 15.080%;
    }
    .aplus .fourth-col {
        width: 23.4637%;
    }

    .aplus .third-col {
        width: 31.8436%;
    }

    .aplus .half-col {
        width: 48.6034%;
    }

    .aplus .two-third-col {
        width: 65.3631%;
    }

    .aplus .three-fourth-col {
        width: 73.7430%;
    }

    .aplus .one-col {
        width: 98.8827%;
        margin-right:0;
    }

    .aplus .last {
        margin-right:0;
    }

    .aplus {
        width: 100%;
        min-width: 895px;
    }
